import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';

export default function ButtonAppBar() {
  return (
    <Box >
      <AppBar position="static"  style={{backgroundColor: "rgb(48 195 48)"}}>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit" href='loginPage'>Login</Button>
          <Button color="inherit" href='registerPage'>Register</Button>
          <Button color="inherit" href='calorieInformation'>Calorie Information Page</Button>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
